import React,{useEffect, useState} from 'react';
import {NavLink} from 'react-router-dom';
import axios  from 'axios';
const NavbarPage = () => {
    
    let value = 1;

    const [user,setUser] = useState([]);
    // let user;
    if(localStorage.getItem('user')) {
        setUser(localStorage.getItem('user'));
        // let user = localStorage.getItem('user');
        // console.log(user);
        value=0;
    }
    const logincredential = () => {
        if (value == 1) {
          return <NavLink className="btn btn-outline-light " exact to="/loginpage"><b>Login</b></NavLink>;
        } else {
          return( 
            <NavLink className="text-white text-decoration-none" exact to="/userprofilepage">
                <b>Hii</b>
            </NavLink>
          )
        }
      }

    return (
        <nav className="navbar navbar-expand-lg navbar-dark bg-info ">
            <div className="container ">
                <NavLink className="navbar-brand " exact to="#">Navbar Logo</NavLink>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                        <li className="nav-item">
                            <NavLink className="nav-link" exact to="/">Home</NavLink>
                        </li>
                        <li className="nav-item">
                            <NavLink className="nav-link" exact to="/aboutpage">About</NavLink>
                        </li>
                        <li className="nav-item">
                            <NavLink className="nav-link" exact to="/contactpage">Contact</NavLink>
                        </li>
                    </ul>
                </div>  
                {logincredential()}
                <b>{user}</b>
                {/* <NavLink className="btn btn-outline-light " exact to="/loginpage"><b>Login</b></NavLink> */}
            </div>
        </nav>
    )
}

export default NavbarPage;
